    },
    {
      name: "TravClan1",
      profile: "System Engineer",
      hiring: "80",
      ctc: "10 LPA",
    },
    {
      name: "InfoEdge1",
      profile: "Testing Engineer",
      hiring: "80",
      ctc: "10LPA",
    },
    {
      name: "ION Group",
      profile: "Genc & Genc next",
      hiring: "80",
      ctc: "14.10 LPA",
    },
    {
      name: "Gemini Solutions1",
      profile: "Technical Trainee",
      hiring: "80",
      ctc: "7.2 - 8 LPA",
    },
    {
      name: "SimplifyVMS1",
      profile: "Software Engineer",
      hiring: "80",
      ctc: "6 LPA",
    },
    {
      name: "Amantya Technology1",
