    {
      name: "Hyundai MOBIS",
      profile: "Genc & Genc next",
      hiring: "80",
      ctc: "4.5 LPA",
    },
    {
      name: "IBM1",
      profile: "Associate Software Engineer",
      hiring: "80",
      ctc: "4.5 LPA",
    },
    {
      name: "Interra Systems1",
