        <p>â­•MEAN Stack Developer</p>
        <p>ðŸ”´WordPress Developers</p>
        <p>ðŸŸ£Cloud Manager</p>
      </div>
      <h1 style={{ marginTop: "3rem" }} className="c2">
        These companies visit in our campus :-
      </h1>
      <div className="compimage">
        <img src={compimg} alt="compimage" />
      </div>
