          </a>
          <a
            href="https://www.linkedin.com/school/kiet-group-of-institutions/?originalSubdomain=in"
            className="iccomp"
          >
            <LinkedInIcon />
          </a>
          <a
            href="https://www.youtube.com/channel/UC4rxBQyVV00oGX9-m2aqKYw"
            className="iccomp"
          >
            <YouTubeIcon />
          </a>
        </div>
      </div>
